function calculaMedianaBolachas(prateleira) {
    prateleira.sort((a, b) => b - a);
    const meio = Math.floor(prateleira.length / 2)
    if (prateleira.length % 2 === 0) {
        return (prateleira[meio] + prateleira[meio - 1]) / 2;
    } else {
        return prateleira[meio]
    }
}

